import { Portfolio } from "./Sections/Portfolio";
import { LinksSection } from "./Sections/LinksSection";

import { NavBar } from "./Sections/NavBar";

import "./index.scss";

function App() {
  return (
    <div>
      <div className="empty-space"></div>
      <LinksSection />
      <NavBar />
      <Portfolio />
      <li>
              <a href="https://www.linkedin.com/in/najja-k-a4403772" class="social-icons"><i
                  class="icon-social-linkedin"></i></a>
            </li>
            <li>
              <a href="https://github.com/nkossally" class="social-icons"><i class="icon-social-github"></i></a>
            </li>
            <li>
              <a href="https://angel.co/najja-kossally?public_profile=1" class="social-icons">A</a>
            </li>
    </div>
  );
}

export default App;
